CREATE DEFINER=`financeiro`@`%` PROCEDURE `sp_statement`(IN dataIni varchar(10), IN dataFim varchar(10), IN accountID int, IN transactionType int)
BEGIN

  set @dataIni := concat_ws(' ', dataIni, '00:00:00');
  set @dataFim := concat_ws(' ', dataFim, '23:59:59');
  set @accountID := accountID;
  set @transactionType:= transactionType;

    select

      date_format(transactions.transaction_date, '%Y%m') as yearmonth,
      year(transactions.transaction_date) as year,
      month(transactions.transaction_date) as month,
      categories.id as category_id,
      categories.name as category,

      (select
         sum(p.value) as val
       from provisions p
         join categories c on c.id = p.category_id
       where
         c.id = categories.id
         and p.transaction_type_id = @transactionType
         and p.account_id = @accountID
         and (transactions.created_at >= p.start_at and transactions.created_at <= p.valid_until)
      ) as provisioned_value,

      (select
         sum(t.value)
       from transactions t
       where t.category_id = categories.id
             and t.transaction_type_id = transactions.transaction_type_id
             and t.account_id = transactions.account_id
             and t.transaction_date between @dataIni and @dataFim
      ) as posted_value

    from transactions
      inner join transaction_types on transaction_types.id = transactions.transaction_type_id
      inner join categories on categories.account_id = @accountID and categories.id = transactions.category_id
      left  join provisions p on p.category_id = categories.id
                                 and p.transaction_type_id = @transactionType
                                 and p.account_id = @accountID
                                 and (transactions.created_at >= p.start_at and transactions.created_at <= p.valid_until)
    where
      transactions.account_id = @accountID and
      transactions.transaction_type_id = @transactionType
      and transactions.transaction_date between @dataIni and @dataFim
    group by date_format(transactions.transaction_date, '%Y%m'), categories.id, categories.name;

END ;;
